<script>
const BOOK_COST = 100;
const DISCOUNT = {
  1: 0,
  2: 0.1,
  3: 0.2,
  4: 0.3,
  5: 0.4,
  6: 0.5,
  7: 0.6,
};
export default {
  computed: {
    cal() {
      if (this.cart.length === 0) {
        return 0;
      }
      const books = this.cart.map((b) => b.id);
      let total = 0;
      const subsets = [];
      while (books.length > 0) {
        const subset = [];
        for (let i = 0; i < books.length; i++) {
          const book = books[i];
          if (!subset.includes(book)) {
            subset.push(book);
            books.splice(i, 1);
            i--;
          }
        }
        subsets.push(subset);
      }
      console.log(subsets);
      for (let j = 0; j < subsets.length; j++) {
        for (let k = j + 1; k < subsets.length; k++) {
          if (subsets[j].length === 5 && subsets[k].length === 3) {
            subsets[k].push(subsets[j].pop());
          }
        }
      }
      subsets.forEach((subset) => {
        total +=
          subset.length * (BOOK_COST - BOOK_COST * DISCOUNT[subset.length]);
      });
      return total;
    },
    calMaxPrice() {
      return this.cart.reduce((a, b) => a + (b["price"] || 0), 0);
    },
  },
  methods: {
    removeFormCart(book) {
      if (this.cartList[book.id].amount >= 1) {
        this.cartList[book.id].amount--;
        const index = this.cart.findIndex((b) => b.id === book.id);
        this.cart.splice(index, 1);
      }
      if (this.cartList[book.id].amount === 0) {
        console.log("delete key");
        delete this.cartList[book.id];
      }
    },
    addToCart(book) {
      this.discount = 0;
      this.cart.push(book);
      if (this.cartList[book.id]) {
        this.cartList[book.id].amount += 1;
      } else {
        book.amount = 1;
        this.cartList[book.id] = book;
      }
    },
  },
